import React from 'react';
import './App.css';

const Navigation = (props) => <nav>
  <ul>
    <li><NavLink to='/'>Home</NavLink></li>
    <li><NavLink to='/cart'>Cart</NavLink></li>
  </ul>
</nav>

function App() {
  return (
    <div className='container'>
      <Navigation />

      <Router />
    </div>
  )
}

export default App;
